- input: "TEXT\x1CC00115527\x1C.TEXT\x1C\x1CF3XA\x1CThe Committee is amending its
    2007 mid-year report to correct a past computer error that the Committee recently
    discovered.  The Committee's reports are based on a computer program that tallies
    its receipts and expenditures.  The Committee recently discovered that, for several
    years, the program had been counting some receipts twice and that as a result,
    the Committee reported a larger amount in unitemized receipts in 2006 and in prior
    years than were actually received.  The Committee has confirmed that the unitemized
    receipts were accurately reported on its 2007 mid-year report.  But, as a result
    of past errors, the cash on hand reported as of January 1, 2007 was inaccurately
    stated.  The amended report corrects that figure.  The Committee has purchased
    new software which will eliminate this mistake.  Please note that the mistake
    resulted solely from a computer error; that the amounts inaccurately reported
    were never actually received or deposited by the Committee; that the mistake was
    confined to unitemized receipts; that all expenditures by the Committee have been
    reported accurately; that the Committee discovered the error and corrected it
    on its own initiative, after consulting with its reports analyst, and that the
    Committee has taken affirmative acction to assure that this mistake will not reoccur."
